const app = require('express')();

app.get('/', (req, res) => {
    res.send(`
        <pre>
        <a href="${req.fusebit.functionId}/hello">/hello - HTML</a><br>
        <a href="${req.fusebit.functionId}/logo">/logo - SVG</a><br>
        <a href="${req.fusebit.functionId}/full-logo">/full-logo - PNG</a><br>
        <a href="${req.fusebit.functionId}/hello-fusebit">/hello-fusebit - HTML with images</a><br>
        <a href="${req.fusebit.functionId}/hello-ejs">/hello-ejs - EJS</a><br>
        </pre>
    `);
})

// Raw HTML
app.get('/hello', (req, res) => {
    res.send(`<h1>Hello, world</h1><p>Current time is ${new Date()}</p>`);
});

