// PNG
app.get('/full-logo', (req, res) => {
    res.set('content-type', 'image/png');
    res.end(Buffer.from(''
        ,'base64'));
});

// HTML with images
app.get('/hello-fusebit', (req, res) => {
    res.send(`
        <h1>Hello, Fusebit</h1><p>
        <p>This is our square logo:</p>
        <img src="logo" />
        <p>And this is our full logo:</p>
        <img src="full-logo" />
    `);
});

// HTML from EJS
app.get('/hello-ejs', (req, res) => {
    res.render('hello', { first: 'John', last: 'Brown' });
});


// This programming model exposes Express app
module.exports = app;